import React from 'react';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableRow from '@material-ui/core/TableRow';

export const TableBodys = props => {

    const { data } = props;

    const body = data && data.map((record) => (
        <TableRow key={record.symbol}>
            <TableCell component="th" scope="row">{record.symbol}</TableCell>
            <TableCell>{record.price_open}</TableCell>
            <TableCell>{record.type}</TableCell>
            <TableCell>{record.series}</TableCell>
            <TableCell>{record.type}</TableCell>
            <TableCell>{record.series}</TableCell>
        </TableRow>
    ))

    return (
        <TableBody>
            {rows.map(row => (
                <TableRow key={row.id}>
                    <TableCell component="th" scope="row">{row.name}</TableCell>
                    <TableCell>{row.itemName}</TableCell>
                    <TableCell>{row.type}</TableCell>
                    <TableCell>{row.series}</TableCell>
                    <TableCell>{row.seriesNumber}</TableCell>
                    <TableCell>{row.quantity}</TableCell>
                    <TableCell>{row.NIB}</TableCell>
                    <TableCell>{row.openComplete}</TableCell>
                    <TableCell>{row.openIncomplete}</TableCell>
                </TableRow>
            ))}
        </TableBody>
    );
};
